CREATE OR REPLACE TABLE shopify-dw.scratch.modelled_outbound_activity
AS

WITH campaign as (
  SELECT cm.account_id, c.name as campaign, c.start_date, c.end_date, ROW_NUMBER() OVER (PARTITION BY account_id ORDER BY cm.created_at DESC) as ranking
  FROM `shopify-dw.base.base__salesforce_banff_campaign_member` cm
    JOIN `shopify-dw.base.base__salesforce_banff_campaign` c 
    ON c.campaign_id = cm.campaign_id AND (lower(c.name) LIKE 'incubation-b2b%' OR LOWER(c.campaign_id) = '7018v000001v8juqac') AND c.is_deleted = false
  WHERE cm.is_deleted = false
)

, mm_outbound_program as (
