, accounts_opps as (
  SELECT a.account_id AS account_id, o.opportunity_id as opportunity_id, DATE(o.close_date) as opportunity_close_date,
    DATE(LAG(close_date) OVER (PARTITION BY a.account_id ORDER BY o.close_date ASC)) AS prev_opportunity_close_date
  FROM `shopify-dw.base.base__salesforce_banff_accounts` a
    left join `shopify-dw.base.base__salesforce_banff_opportunities` o
    on a.account_id = o.account_id
  WHERE a.is_deleted = false AND o.is_deleted = false)

, tasks_and_events as (
  select 
  id as task_id,
  AccountId as account_id, 
  ActivityDate as activity_date,
  ActivityDateTime as completed_date_time,
  CreatedById as created_by_id, 
  CreatedDate as created_date,
  IsDeleted as is_deleted,
  OwnerId as owner_id,
  Activity_Type__c as activity_type,
  Activity_Sub_Type__c as activity_sub_type,
  WhatId as what_id,
  SalesLoft1__Call_Disposition__c as salesloft_call_disposition,
  SalesLoft1__Call_Duration_in_Minutes__c as salesloft_call_duration_in_minutes,
  SalesLoft1__Call_Sentiment__c as salesloft_call_sentiment,
  SalesLoft1__SalesLoft_Cadence_Name__c as salesloft_cadence_name,
  SalesLoft1__SalesLoft_Clicked_Count__c as salesloft_clicked_count,
  SalesLoft1__SalesLoft_Connected_Count__c as salesloft_connected_count,
  SalesLoft1__SalesLoft_Email_Template_Title__c as salesloft_email_template_title,
  SalesLoft1__SalesLoft_Replies_Count__c as salesloft_replies_count,
  SalesLoft1__SalesLoft_Type__c as salesloft_type,
  SalesLoft1__SalesLoft_Unique_Click_Count__c as salesloft_unique_click_count,
  SalesLoft1__SalesLoft_Unique_Reply_Count__c as salesloft_unique_reply_count,
  SalesLoft1__SalesLoft_Unique_View_Count__c as salesloft_unique_view_count,
  SalesLoft1__SalesLoft_View_Count__c as salesloft_view_count
-- from sdp-prd-commercial.raw_salesforce_banff.from_longboat_events
from `shopify-dw.raw_salesforce_banff.event`

UNION ALL

select 
  id as task_id,
  AccountId as account_id, 
  ActivityDate as activity_date,
  CompletedDateTime as completed_date_time,
  CreatedById as created_by_id, 
  CreatedDate as created_date,
  IsDeleted as is_deleted,
  OwnerId as owner_id,
  Activity_Type__c as activity_type,
  Activity_Sub_Type__c as activity_sub_type,
  WhatId as what_id,
  SalesLoft1__Call_Disposition__c as salesloft_call_disposition,
  SalesLoft1__Call_Duration_in_Minutes__c as salesloft_call_duration_in_minutes,
  SalesLoft1__Call_Sentiment__c as salesloft_call_sentiment,
  SalesLoft1__SalesLoft_Cadence_Name__c as salesloft_cadence_name,
  SalesLoft1__SalesLoft_Clicked_Count__c as salesloft_clicked_count,
  SalesLoft1__SalesLoft_Connected_Count__c as salesloft_connected_count,
  SalesLoft1__SalesLoft_Email_Template_Title__c as salesloft_email_template_title,
  SalesLoft1__SalesLoft_Replies_Count__c as salesloft_replies_count,
  SalesLoft1__SalesLoft_Type__c as salesloft_type,
  SalesLoft1__SalesLoft_Unique_Click_Count__c as salesloft_unique_click_count,
  SalesLoft1__SalesLoft_Unique_Reply_Count__c as salesloft_unique_reply_count,
  SalesLoft1__SalesLoft_Unique_View_Count__c as salesloft_unique_view_count,
  SalesLoft1__SalesLoft_View_Count__c as salesloft_view_count
from `shopify-dw.raw_salesforce_banff.task`
where IsDeleted = false
)

,final as (
SELECT t.task_id, t.account_id, o.id as opportunity_id, t.created_by_id, t.owner_id as assigned_to_id, DATE(t.activity_date) as activity_date, t.created_date as task_created_date, DATE(t.completed_date_time) as task_completed_date, u_cb.name as task_created_by, ur_cb.name as task_created_by_role, u_at.name as task_assigned_to, ur_at.name as task_assigned_to_role, campaign.campaign as account_campaign, camp.name as opportunity_campaign, fun.market_segment as opportunity_market_segment,
  CASE WHEN LOWER(campaign.campaign) like 'incubation-smb%' OR LOWER(camp.name) like 'incubation-smb%' OR UPPER(ur_cb.name) LIKE '%INC%' OR UPPER(ur_at.name) LIKE '%INC%' OR UPPER(fun.market_segment) LIKE '%INC%' THEN 1 END is_incubation_influenced,
  case when mm.id IS NOT NULL then 'Y' ELSE 'N' end as is_mm_outbound_program_account,
  case
      WHEN LOWER(coalesce(t.salesLoft_type, t.activity_type)) IN ('email', 'reply') THEN 'Email'
      WHEN LOWER(coalesce(t.salesLoft_type, t.activity_type)) IN ('linkedin - connection request', 'linkedin - inmail', 'linkedin - research') THEN 'LinkedIn'
      WHEN LOWER(coalesce(t.salesLoft_type, t.activity_type)) IN ('call', 'message') THEN 'Call'
      WHEN LOWER(coalesce(t.salesLoft_type, t.activity_type)) IN ('meeting', 'in-person meeting') THEN 'Meeting'
      ELSE 'Other'
    END AS activity_type, o.Opportunity_Source__c,
    srr.market_segment, srr.team_segment, srr.sales_region,
  -- CASE WHEN ur_at.name LIKE '%INC%' AND NOT(campaign.campaign LIKE '%Incubation-SMB%' OR camp.name LIKE '%Incubation-SMB%') THEN 'Incubation B2B'
  --   -- WHEN ur_at.name LIKE '%MM%' AND ur_at.name NOT LIKE '%X%' AND o.opportunity_source = 'Outbound' THEN 'Mid Market'
  --   WHEN ur_at.name LIKE 'AMER-SALES-REP-MM%' OR ur_at.name LIKE 'AMER-SDR-REP-MM%' OR (ur_at.name LIKE 'AMER-SALES-REP-MM%' AND o.opportunity_source = 'Outbound') THEN 'Mid Market' -- need to add EMEA and APJ to this
  --   WHEN ur_at.name LIKE '%N3-RETAIL%' AND o.opportunity_source = 'Outbound' THEN 'N3 Retail AE' END as task_assigned_to_segment,
  -- CASE WHEN ur_at.name LIKE 'AMER-%' THEN 'AMER'
  --   WHEN ur_at.name LIKE 'EMEA-%' THEN 'EMEA'
  --   WHEN ur_at.name LIKE 'APAC-%' THEN 'APAC'
  -- END AS task_assigned_to_region
-- FROM sdp-prd-commercial.raw_salesforce_banff.from_longboat_tasks t
FROM tasks_and_events t
  LEFT JOIN accounts_opps acc ON t.account_id = acc.account_id AND COALESCE(t.what_id,'') NOT LIKE '0068%' AND DATE(t.created_date) BETWEEN COALESCE(DATE_ADD(prev_opportunity_close_date,INTERVAL 1 DAY),DATE('1900-01-01')) AND opportunity_close_date
  LEFT JOIN `shopify-dw.raw_salesforce_banff.opportunity` o ON COALESCE(t.what_id,acc.opportunity_id) = o.id
  LEFT JOIN (SELECT DISTINCT opportunity_id, market_segment FROM `shopify-dw.marts.sales_funnel_accumulating_facts`) fun ON o.id = fun.opportunity_id
  LEFT JOIN `shopify-dw.base.base__salesforce_banff_campaign` camp ON o.CampaignId = camp.campaign_id
  LEFT JOIN `shopify-dw.base.base__salesforce_banff_users` u_cb ON t.created_by_id = u_cb.user_id
  LEFT JOIN `shopify-dw.base.base__salesforce_banff_user_roles` ur_cb ON ur_cb.user_role_id = u_cb.user_role_id
  LEFT JOIN `shopify-dw.base.base__salesforce_banff_users` u_at ON t.owner_id = u_at.user_id
  LEFT JOIN `shopify-dw.base.base__salesforce_banff_user_roles` ur_at ON ur_at.user_role_id = u_at.user_role_id
  LEFT JOIN campaign ON t.account_id = campaign.account_id AND DATE(t.created_date) BETWEEN DATE(campaign.start_date) AND DATE(campaign.end_date) AND campaign.ranking = 1
  LEFT JOIN mm_outbound_program mm ON t.account_id = mm.id
  LEFT JOIN `sdp-prd-commercial.raw_google_sheets.from_longboat_revenue_sales_rep_role` srr ON ur_cb.name = srr.sales_rep_role
WHERE t.account_id IS NOT NULL
AND t.is_deleted = false
  AND DATE(t.completed_date_time) >= '2023-01-01'
)

SELECT 
  task_assigned_to, task_assigned_to_role, 
-- task_assigned_to_segment, 
  market_segment, team_segment, sales_region, activity_type, task_completed_date,
-- task_assigned_to_region, 
  is_mm_outbound_program_account, COUNT(*) as tasks_count, COUNT(DISTINCT account_id) as accounts_touched_count,
  EXTRACT(YEAR FROM DATE(task_completed_date)) AS completed_activity_date_year, 
  EXTRACT(WEEK FROM DATE(task_completed_date)) AS completed_activity_date_week, 
  FORMAT_DATE('%B', DATE(task_completed_date)) as month,
  FORMAT_DATE('%A', DATE(task_completed_date)) as completed_weekday_name, -- this is to have the weekday names like Monday, Tuesday, etc.
  DATE_TRUNC(DATE(task_completed_date), week(monday)) as week_of_completed_date
FROM final 
WHERE market_segment IS NOT NULL
and task_completed_date <= current_date('America/Los_Angeles')
GROUP BY 1,2,3,4,5,6,7,8
ORDER BY final.task_completed_date
